import React from 'react';
import '../App.css';
import './info.css';
import './Cards.css';
import { Grid } from '@material-ui/core';
import GridItem from './GridItem'


function Info() {
  return (
    <section className='info-container'>
       Upcoming Events
        <Grid container 
        direction="row"
        justify="center"
        alignItems="center"
        >
        

            <Grid container item s ={5} spacing={1} background= 'none'><GridItem /></Grid>
       
       

      </Grid>
      <div classname='info-box'>
        
      <h1>Previous Events</h1>
      <ul>
       
       <li className = 'info-event'>SinterKlass Boxes</li>
       <li className = 'info-event'>Raffle</li>
       <li className = 'info-event'>Event 3</li>
 

   </ul>

      </div>
    
    

      
            </section>
  );
}

export default Info;
